INSERT INTO `schoolinfoall` VALUES ('1219', '山东大学（威海）', '山东威海市', '山东威海市人气值:5700483', '官方网址：https://bkzsw.wh.sdu.edu.cn/http://www.wh.sdu.edu.cn\n官方电话：0631-5688282,0631-5688902,0631-5688895\n电子邮箱：whzhaob@sdu.edu.cn', '山东大学是一所历史悠久、学科齐全、学术实力雄厚、办学特色鲜明，在国内外具有重要影响的教育部直属重点综合性大学，是世界一流大学建设高校（A类）。威海校区创建于1984年，是山东大学与威海市政府联合共建的多学科、开放式、综合性大学校区。她的诞生，开创了我国名校异地办学的先河；她的成长，印证了改革开放以来我...更多>', 24);
