INSERT INTO `schoolinfoall` VALUES ('134', '东北大学', '辽宁沈阳市', '辽宁沈阳市人气值:13835950', '官方网址：http://zs.neu.edu.cn/http://www.neu.edu.cn/\n官方电话：024-83687392,024-23891272\n电子邮箱：ddzsb@mail.neu.edu.cn', '东北大学始建于1923年4月26日，是一所具有爱国主义光荣传统的大学。1928年8月至1937年1月，著名爱国将领张学良将军兼任校长。1931年“九•一八”事变后，东北大学被迫流亡办学，1949年3月，在东北大学工学院和理学院（部分）的基础上成立沈阳工学院。1950年8月，定名为东北工学院，1993年3月，复名为东北大学，1997年1月原沈阳黄金学院并入...更多>', 42);
