INSERT INTO `schoolinfoall` VALUES ('117', '中国药科大学', '江苏南京市', '江苏南京市人气值:7664680', '官方网址：http://zb.cpu.edu.cnhttp://www.cpu.edu.cn/\n官方电话：025-83271319,025-83271422\n电子邮箱：zhaosheng@cpu.edu.cn', '中国药科大学坐落于古都南京，始建于1936年，是我国历史上第一所由国家创办的药学高等学府。学校为教育部直属、国家“211工程”和“985工程优势学科创新平台”建设高校，是一所以药学为特色的多科性、研究型大学，其中以药学、中药学学科为龙头的药学学科群建设始终保持国内领先水平，素有“中国生物医药人才摇篮”的美誉。20...更多>', 44);
INSERT INTO `schoolinfoall` VALUES ('284', '深圳大学', '广东深圳市', '广东深圳市人气值:16238279', '官方网址：http://zs.szu.edu.cnhttp://www.szu.edu.cn/\n官方电话：0755-26536235,0755-26736235\n电子邮箱：zsb@szu.edu.cn', '深圳大学1983年经国家教育部批准设立，肩负着为特区培养人才和为国家高等教育改革探路的光荣使命。中央、教育部和地方高度重视深圳大学建设，组织北大援建中文、外语类学科，清华援建电子、建筑类学科，人大援建经济、法律类学科，一大批知名学者云集深圳大学。建校伊始，学校在高校管理体制上锐意改革，在奖学金、学分...更多>', 45);
