INSERT INTO `schoolinfoall` VALUES ('78', '天津医科大学', '天津和平区', '天津和平区人气值:7931090', '官方网址：http://www.tmu.edu.cn/bkzs/http://www.tmu.edu.cn/\n官方电话：022-83336711\n电子邮箱：zhaoban@tmu.edu.cn', '天津医科大学的前身天津医学院创建于1951年，是新中国成立后原国家政务院批准建立的高等医学院校。著名内分泌学家、医学教育家朱宪彝教授为首任校长。1994年6月天津医学院与天津第二医学院正式组建成立天津医科大学。1996年12月成为天津市唯一的国家“211工程”重点建设市属院校，2015年10月成为天津市人民政府、国家卫生健康委员会和...更多>', 51);
