INSERT INTO `schoolinfoall` VALUES ('97', '兰州大学', '甘肃兰州市', '甘肃兰州市人气值:12197416', '官方网址：http://zsb.lzu.edu.cnhttp://www.lzu.edu.cn/\n官方电话：0931-5196678,0931-8912116\n电子邮箱：zsb@lzu.edu.cn', '兰州大学是教育部直属全国重点综合性大学，在国家高等教育格局中具有重要战略地位，在国内外具有重要影响和良好声誉。学校创建于1909年，始为甘肃法政学堂，是中国西北地区第一个具有现代意义的高等学校。1928年，扩建为兰州中山大学。1946年，更名为国立兰州大学。新中国成立后，在高等学校院系调整中，被确定为国家14所综...更多>', 57);
