INSERT INTO `schoolinfoall` VALUES ('50', '辽宁大学', '辽宁沈阳市', '辽宁沈阳市人气值:8673593', '官方网址：http://zs.lnu.edu.cn/http://www.lnu.edu.cn\n官方电话：024-62202299', '辽宁大学是一所具备文、史、哲、经、管、法、理、工、医、艺等学科门类的综合性大学，是国家“211工程”重点建设院校和国家“双一流”建设高校。学校现有三个校区，即沈阳崇山校区、沈阳蒲河校区和辽阳武圣校区。学校占地面积2222亩，校舍建筑面积65万平方米。辽宁大学源起于1948年11月东北人民政府在沈阳建立的商业专门学...更多>', 62);
