INSERT INTO `schoolinfoall` VALUES ('115', '南京师范大学', '江苏南京市', '江苏南京市人气值:9631427', '官方网址：http://bkzs.njnu.edu.cnhttp://www.njnu.edu.cn/\n官方电话：025-83720759\n电子邮箱：sun@njnu.edu.cn', '南京师范大学是国家“双一流”建设高校和江苏高水平大学建设高校。学校的主源可追溯到1902年创办的三江师范学堂，该学堂是中国高等师范教育的发祥地之一。后历经两江优级师范学堂、南京高等师范学校、国立东南大学、国立第四中山大学、江苏大学、国立中央大学、国立南京大学等时期；其另一源头为1888年创办的汇文书院，后发展...更多>', 65);
