INSERT INTO `schoolinfoall` VALUES ('49', '北京中医药大学', '北京朝阳区', '北京朝阳区人气值:7039805', '官方网址：http://bkzs.bucm.edu.cnhttp://www.bucm.edu.cn/\n官方电话：010-64286231\n电子邮箱：zs@bucm.edu.cn', '北京中医药大学是一所以中医药学为主干学科的全国重点大学，直属教育部管理，由教育部、国家卫生健康委员会、国家中医药管理局和北京市共建。学校现任党委书记王瑶琪，校长徐安龙。北京中医药大学始建于1956年，前身为北京中医学院，是国务院批准最早创办的高等中医药院校。1960年，被中央确定为全国重点高校；1993年，更名为北京中...更多>', 71);
