INSERT INTO `schoolinfoall` VALUES ('317', '上海电力大学', '上海杨浦区', '上海杨浦区人气值:6093224', '官方网址：https://zs.shiep.edu.cn/http://www.shiep.edu.cn\n官方电话：021-61655278', '上海电力大学是中央与上海市共建、以上海市管理为主的全日制普通高等院校。学校创建于1951年，1985年1月升格为本科，更名为上海电力学院，2018年12月，经教育部批准更名为上海电力大学。学校现有杨浦、浦东两个校区，全日制在校生一万四千余人，教职工一千余人。学校的校训是“爱国、勤学、务实、奋进”，学校坚持“立足电...更多>', 110);
