INSERT INTO `schoolinfoall` VALUES ('289', '广州中医药大学', '广东广州市', '广东广州市人气值:5198063', '官方网址：https://xsc.gzucm.edu.cn/bzkzs/zsxx/zszc.htmhttps://www.gzucm.edu.cn/\n官方电话：020-39357999,020-39357088\n电子邮箱：zsb@gzucm.edu.cn', '广州中医药大学办学基础为创立于1924年的广东中医药专门学校。1956年经国务院批准成立广州中医学院，是新中国首批四所高等中医药本科院校之一，1995年更名为广州中医药大学。原直属国家卫生部，2000年转由广东省人民政府管理。2017年入选国家“双一流”学科建设高校，2018年晋级广东省高水平大学重点建设高校，2020年成为广东省...更多>', 138);
