INSERT INTO `schoolinfoall` VALUES ('385', '湘潭大学', '湖南湘潭市', '湖南湘潭市人气值:9867604', '官方网址：https://zhaosheng.xtu.edu.cn/recruit/index/indexhttps://www.xtu.edu.cn/\n官方电话：0731-58293807,0731-58292814,0731-58292841\n电子邮箱：zhaosheng@xtu.edu.cn', '湘潭大学简称“湘大”，是一代伟人毛泽东同志亲自倡办的综合性全国重点大学、国家“双一流”建设高校。学校创办于1958年，同年9月10日，毛泽东同志亲笔题写“湘潭大学”校名，并亲切嘱托“一定要把湘潭大学办好”。1974年，邓小平、李先念等中央领导同志批准湘潭大学复校。1978年，学校被国务院确定为全国16所文理工综合性重点大...更多>', 146);
