INSERT INTO `schoolinfoall` VALUES ('224', '沈阳大学', '辽宁沈阳市', '辽宁沈阳市人气值:4659796', '官方网址：https://zsjy.syu.edu.cn/zsxxw.htmhttp://www.syu.edu.cn/\n官方电话：024-62268563,024-62721597,024-62268564', '沈阳大学是经教育部批准并面向全国招生的全日制普通高等学校。学校办学历史可追溯至1905年建立的奉天实业学堂和1906年建立的新民公学堂。目前，学校已发展成为一所以本科教育为主体，同时拥有博士、硕士研究生教育和继续教育、留学生教育的综合性大学，是辽宁省办学历史最悠久、学科门类最齐全的大学之一。学校先后成为教...更多>', 218);
