INSERT INTO `schoolinfoall` VALUES ('499', '青岛大学', '山东青岛市', '山东青岛市人气值:17802300', '官方网址：https://zs.qdu.edu.cn/http://www.qdu.edu.cn\n官方电话：0532-83780009,0532-83780001\n电子邮箱：zsb@qdu.edu.cn', '青岛大学是山东省重点建设高校、山东省和青岛市共建高校、山东省高水平大学和高水平学科建设高校。学校办学历史可追溯至1909年创办的青岛特别高等专门学堂。1993年由原青岛大学、山东纺织工学院、青岛医学院、青岛师范专科学校等合并组建而成。百十余年来，学校教授高深学问，养成硕学闳才，应国家之需要，薪火相传，砥砺奋...更多>', 220);
