INSERT INTO `schoolinfoall` VALUES ('473', '福建师范大学', '福建福州市', '福建福州市人气值:8848092', '官方网址：https://zsb.fjnu.edu.cn/http://www.fjnu.edu.cn\n官方电话：0591-22867412,0591-22867413\n电子邮箱：zszx@fjnu.edu.cn', '福建师范大学坐落于素有“海滨邹鲁”之誉的历史文化名城福州，是一所历史悠久、声誉斐然的百年省属高等学府。学校肇始于1907年清朝帝师陈宝琛先生创办的“福建优级师范学堂”，后由华南女子文理学院、福建协和大学、福建省立师范专科学校等单位几经调整合并，于1953年成立福建师范学院，1972年易名为福建师范大学并沿用至今。2...更多>', 236);
