INSERT INTO `schoolinfoall` VALUES ('514', '贵州师范大学', '贵州贵阳市', '贵州贵阳市人气值:5097528', '官方网址：http://zjc.gznu.edu.cn/sdzs/https://www.gznu.edu.cn/\n官方电话：0851-86701855,0851-88909960\n电子邮箱：zjc@gznu.edu.cn', '贵州师范大学的前身——“国立贵阳师范学院”创建于1941年，是当时全国八所国立师范学院之一。1950年10月更名为“贵阳师范学院”；1954年10月教育部委托贵州省人民政府管理；1985年更名为“贵州师范大学”。1996年被贵州省人民政府确定为省属重点大学；2015年成为教育部与贵州省人民政府共建的高等学校；2017年入选“国家级首批深...更多>', 250);
