INSERT INTO `schoolinfoall` VALUES ('2461', '湖北恩施学院', '湖北恩施土家族苗族自治州', '湖北恩施土家族苗族自治州人气值:992920', '官方网址：https://zs.hbesxy.edu.cnhttps://www.hbesxy.edu.cn\n官方电话：0718-8438998,0718-8965960\n电子邮箱：zs@hbesxy.edu.cn', '学校简介湖北恩施学院（原湖北民族大学科技学院）坐落在世界硒都，人间仙境，天然氧吧，美丽如画的湖北恩施，是国家教育部批准设立的全日制普通本科高校。学校于2003年3月创办，2012年5月获得学士学位授予权；2021年2月，经教育部批准，转设更名为湖北恩施学院。现面向全国24个省份招生，全日制在校生近1.6万人。育人理念学校...更多>', 254);
INSERT INTO `schoolinfoall` VALUES ('459', '河南大学', '河南郑州市', '河南郑州市人气值:13999227', '官方网址：http://zs.henu.edu.cn/https://www.henu.edu.cn/\n电子邮箱：hedazhaoban@126.com', '河南大学是一所办学历史悠久、学科门类齐全、专业特色鲜明、文化底蕴深厚的国家“双一流”建设高校。河南大学创立于1912年，始名河南留学欧美预备学校，首任校长为林伯襄先生，校园选建于河南贡院旧址之上。后历经中州大学、国立开封中山大学（又称国立第五中山大学）、省立河南大学等阶段，1942年升格为国立河南大学。195...更多>', 255);
INSERT INTO `schoolinfoall` VALUES ('255', '绍兴文理学院', '浙江绍兴市', '浙江绍兴市人气值:2422644', '官方网址：http://zs.usx.edu.cnhttps://www.usx.edu.cn/\n官方电话：0575-88345555\n电子邮箱：sxwlxyzsbgs@163.com', '绍兴文理学院是教育部批准的普通全日制综合性高等学校，坐落于历史文化名城绍兴。学校的办学历史可追溯到1909年创办的山会初级师范学堂，鲁迅先生曾出任山会初级师范学堂监督（校长）。1996年绍兴师范专科学校与绍兴高等专科学校等合并建立绍兴文理学院。2000年绍兴卫生学校、上虞师范学校、绍兴市城乡建设职工中等专业学校相继...更多>', 256);
