INSERT INTO `schoolinfoall` VALUES ('285', '五邑大学', '广东江门市', '广东江门市人气值:4506487', '官方网址：http://www.wyu.edu.cn/zsb/http://www.wyu.edu.cn/\n官方电话：0750-3296263,0750-3296265\n电子邮箱：wyuzsb@126.com', '五邑大学是由广东省人民政府于1985年设立的以工科为主的多科性大学，是广东省较早获得硕士、学士学位授予权的地方高校，具有接收港澳台侨学生、国际学生资格和推荐优秀应届本科毕业生免试攻读研究生资格，现为广东省高水平理工科大学建设高校、博士学位授予立项建设单位。学校坚持践行“好学、多思、求实、创新”的校训...更多>', 261);
