INSERT INTO `schoolinfoall` VALUES ('267', '中国民用航空飞行学院', '四川德阳市', '四川德阳市人气值:4747368', '官方网址：http://zsc.cafuc.edu.cnhttp://www.cafuc.edu.cn/\n官方电话：0838-5182078\n电子邮箱：zsk@cafuc.edu.cn', '中国民用航空飞行学院，简称“中飞院”，创建于1956年，是中国民用航空局直属的全日制普通高等学校，是中国民用航空局与四川省共建高校。学院作为中国民航培养高素质人才的主力高校，经过60多年的建设与发展，已成为全球民航职业飞行员培养规模最大、能力最强、水平最高，享誉国内、在世界民航有着较高影响力的高等学府。中国民...更多>', 265);
