INSERT INTO `schoolinfoall` VALUES ('507', '青岛科技大学', '山东青岛市', '山东青岛市人气值:10502737', '官方网址：https://zs.qust.edu.cn/http://www.qust.edu.cn\n官方电话：0532-88957996\n电子邮箱：zsb@qust.edu.cn', '青岛科技大学是一所以工为主，理、工、文、经、管、医、法、艺、教等学科协调发展、特色鲜明的多科性大学。学校是国家“111计划”立项建设单位、山东省“强特色”高水平大学，被教育部评估为“本科教学工作水平评估优秀高校”“全国毕业生就业创业双50强高校”，被社会赞誉为“中国橡胶工业的黄埔”。学校历史底蕴厚重，前身...更多>', 267);
INSERT INTO `schoolinfoall` VALUES ('364', '西藏大学', '西藏拉萨市', '西藏拉萨市人气值:2784316', '官方网址：http://www.utibet.edu.cn\n官方电话：0891-6405900\n电子邮箱：zsb@utibet.edu.cn', '西藏大学是西藏自治区所属综合性大学，是国家“211工程”重点建设大学，2013年列入“中西部高等教育振兴计划”，2017年入选首轮“双一流”学科建设高校，2018年成为教育部、西藏自治区人民政府合建高校，2022年入选第二轮“双一流”建设高校。学校办学历史可追溯到1951年人民解放军进藏部队创办的藏文干部训练班，历经西藏军区...更多>', 268);
INSERT INTO `schoolinfoall` VALUES ('273', '四川轻化工大学', '四川自贡市', '四川自贡市人气值:6487680', '官方网址：http://zjc.suse.edu.cn/http://www.suse.edu.cn/\n官方电话：0813-5505999,0813-5505678', '四川轻化工大学是四川省人民政府、国家国防科技工业局共建高校，是一所工学、理学、管理学、教育学、文学、历史学、艺术学、法学、经济学等九大学科协调发展的具有近六十年本科教育、近二十年研究生教育历程的普通全日制高等学校。学校坐落于两个国家历史文化名城自贡市和宜宾市，拥有李白河、汇东、宜宾、黄岭四个校...更多>', 269);
