INSERT INTO `schoolinfoall` VALUES ('391', '南华大学', '湖南衡阳市', '湖南衡阳市人气值:15374647', '官方网址：http://zsw.usc.edu.cn/https://www.usc.edu.cn/\n官方电话：0734-8282553\n电子邮箱：zs@usc.edu.cn', '南华大学由中南工学院与衡阳医学院于2000年3月合并组建，2002年10月，核工业第六研究所并入。中南工学院的前身是1959年创办的衡阳矿冶工程学院，衡阳医学院的前身为创建于1958年的湖南省衡阳医学院。学校由工业和信息化部、生态环境部、国家卫生健康委员会、国家国防科技工业局、中国核工业集团公司与湖南省人民政府共建，是...更多>', 271);
