INSERT INTO `schoolinfoall` VALUES ('377', '长春大学', '吉林长春市', '吉林长春市人气值:5383233', '官方网址：http://zsb.ccu.edu.cnhttp://www.ccu.edu.cn/\n官方电话：0431-85250087,13604367767\n电子邮箱：zsb@ccu.edu.cn', '长春大学坐落在素有“北国春城”之称的吉林省长春市，是一所底蕴厚重、特色鲜明的省属综合性大学。学校前身是1949年由原东北人民政府工业部创办的长春工业会计统计专门学校，为新中国培养了第一批工业会计统计人才。在同步国家发展与时代变革中学校数次易名，1983年更名为吉林机电专科学校。1987年经原国家教育委员会批准...更多>', 274);
INSERT INTO `schoolinfoall` VALUES ('578', '北京农学院', '北京昌平区', '北京昌平区人气值:1789010', '官方网址：http://zsb.bua.edu.cn/https://www.bua.edu.cn/\n官方电话：010-80799334,010-80796306\n电子邮箱：buazsb@163.com', '北京农学院的前身河北省通县农业学校，创建于1956年。1958年，河北省通县农业学校与北京市农业合作干部学校合并，更名为北京市农业学校。1965年，在北京市农业学校的基础上建立半农半读的北京农业劳动大学。1978年，经国务院批准更名为北京农学院。学校总占地面积1100余亩，校舍建筑总面积29万余平方米，建有千亩农场、万亩林...更多>', 275);
