INSERT INTO `schoolinfoall` VALUES ('435', '湖北汽车工业学院', '湖北十堰市', '湖北十堰市人气值:1850286', '官方网址：http://zs.huat.edu.cnhttp://www.huat.edu.cn/\n官方电话：0719-8238223\n电子邮箱：zsb@huat.edu.cn', '湖北汽车工业学院坐落于世界著名道教文化圣地武当山北麓、汉江秀水之滨、南水北调源头，中国商用车之都的湖北省十堰市，是全国唯一一所以汽车命名、最具汽车特色的公办普通高等院校，也是湖北省“园林式校园”、“湖北省省级文明（单位）校园”。一、学校发展概况1.因车而建，多科协调发展学校创建于1972年，前身是东风...更多>', 280);
