INSERT INTO `schoolinfoall` VALUES ('477', '闽江学院', '福建福州市', '福建福州市人气值:5145719', '官方网址：http://zsb.mju.edu.cnhttp://www.mju.edu.cn/\n官方电话：0591-83761856\n电子邮箱：mjzsb@163.com', '闽江学院坐落于福建省省会福州市，是2002年经教育部批准设立的全日制普通本科高校。前身是1958年创办的福州师范高等专科学校和1984年创办的闽江职业大学(简称“闽大”，含2001年并入的福州工艺美术学校)，2010年，爱国华侨蔡继琨先生创办的福建音乐学院并入闽江学院。学校现为“服务国家特殊需求”硕士专业学位研究生教育试点...更多>', 304);
