INSERT INTO `schoolinfoall` VALUES ('1043', '西安文理学院', '陕西西安市', '陕西西安市人气值:4051093', '官方网址：http://zsjyc.xawl.edu.cn/http://www.xawl.edu.cn/\n官方电话：029-88221619,029-88221907\n电子邮箱：xawlzsb@163.com', '西安文理学院位于陕西省省会西安市。学校是2003年经教育部批准，由西安市政府主办、省市共建、面向全国招生的一所全日制普通本科高校。先后由西安大学、西安师范专科学校、西安教育学院、西安幼儿师范学校和西安师范学校合并而成，办学历史可追溯至1903年设立的陕西师范学堂。学校秉承关中书院“躬行实践、经世致用、敦本...更多>', 354);
