INSERT INTO `schoolinfoall` VALUES ('338', '合肥学院', '安徽合肥市', '安徽合肥市人气值:3474226', '官方网址：http://www.hfuu.edu.cn/zs/http://www.hfuu.edu.cn\n官方电话：0551-62158118,0551-62159118', '合肥学院是一所在“改革中诞生，开放中成长，创新中发展”的省市共建、以市为主的全日制公办本科院校，其前身是创办于1980年的合肥联合大学，由新中国放射化学奠基人、中国科学技术大学副校长杨承宗先生任首任校长，创办伊始即实行本科招生。学校实行的“适当收费、不包分配、按社会需求设置专业、后勤社会化”办学模式...更多>', 423);
