INSERT INTO `schoolinfoall` VALUES ('199', '石河子大学', '新疆自治区直辖县级行政区划', '新疆自治区直辖县级行政区划人气值:8809751', '官方网址：http://zsb.shzu.edu.cn/http://www.shzu.edu.cn/\n官方电话：0993-2055960,0993-2055970\n电子邮箱：zsb@shzu.edu.cn', '『历史沿革』1949年，中国人民解放军解放新疆的进军途中，第一兵团司令员王震指示创办了中国人民解放军第一兵团卫生学校（1978年发展为石河子医学院），成为石河子大学的前身。1958年，兵团党委创办兵团农学院（1979年改名石河子农学院），1959年创办了兵团会计培训队（1987年发展为兵团经济专科学校），1960年创建了兵团师范专科学校（1...更多>', 426);
INSERT INTO `schoolinfoall` VALUES ('544', '宁夏大学', '宁夏银川市', '宁夏银川市人气值:3223036', '官方网址：http://zs.nxu.edu.cn/https://www.nxu.edu.cn/\n官方电话：0951-2061777,0951-2061778\n电子邮箱：zsb@nxu.edu.cn', '宁夏大学是教育部与宁夏回族自治区人民政府合建高校，国家“双一流”建设高校，国家“211工程”重点建设高校。宁夏大学始建于1958年。1997年12月，宁夏大学与原宁夏工学院、银川师专（含宁夏教育学院）合并；2002年2月，与宁夏农学院合并，组建了新的宁夏大学；2014年4月，宁夏大学中卫校区成立，揭开了学校改革发展崭新一页。...更多>', 427);
INSERT INTO `schoolinfoall` VALUES ('785', '阿坝师范学院', '四川阿坝藏族羌族自治州', '四川阿坝藏族羌族自治州人气值:1363574', '官方网址：http://zs.abtu.edu.cn/http://www.abtu.edu.cn/\n官方电话：028-62332777\n电子邮箱：abtuzb@163.com', '阿坝师范学院创办于1978年，所在地阿坝藏族羌族自治州是红军“爬雪山，过草地”大无畏长征精神的主要发源地。学校原址汶川县威州镇，2008年“5·12”汶川特大地震后，迁至成都郫县古城、团结两镇和彭州市“一校三区”异地复课，2011年迁址汶川县水磨镇，2015年升格为本科院校。学校由四川省人民政府举办、四川省教育厅主管，现有全日制在...更多>', 428);
