INSERT INTO `schoolinfoall` VALUES ('653', '防灾科技学院', '河北廊坊市', '河北廊坊市人气值:3450297', '官方网址：https://zjb.cidp.edu.cn/zswsy.htmhttp://www.cidp.edu.cn\n官方电话：010-61596244\n电子邮箱：fzzsb@cidp.edu.cn', '防灾科技学院隶属于中国地震局，是全国仅有的以防灾减灾救灾高等教育为主、学科门类齐全的综合性全日制普通高等学校。学校始建于1975年，面向全国招生，现有全日制在校生9200余人。2021年2月，应急管理部党委决定合并华北科技学院和防灾科技学院筹建应急管理大学。学校立足防灾减灾行业，面向应急管理事业和经济社会发展，...更多>', 433);
