INSERT INTO `schoolinfoall` VALUES ('1102', '西安航空学院', '陕西西安市', '陕西西安市人气值:2295766', '官方网址：http://zb.xaau.edu.cnhttp://www.xaau.edu.cn/\n官方电话：029-84257775,029-84250446\n电子邮箱：zb@xaau.edu.cn', '西安航空学院是一所以工科为主、多学科协调发展的全日制普通高等学校，位于历史文化名城西安。学校创建于1955年，原名为西安航空工业学校，隶属原航空工业部。1957年合并兰州航空工业学校。1960年升格为专科学校，更名为西安航空工业专科学校，后因国民经济调整而复原。1985年经原国家教委批准升格为西安航空工业技术专科学校，1...更多>', 435);
