INSERT INTO `schoolinfoall` VALUES ('599', '燕山大学', '河北秦皇岛市', '河北秦皇岛市人气值:7454862', '官方网址：https://zsjyc.ysu.edu.cn/bkszsxxw/wzsy.htmhttp://www.ysu.edu.cn\n官方电话：0335-8057069', '燕山大学是河北省人民政府、教育部、工业和信息化部、国家国防科技工业局四方共建的全国重点大学，河北省重点支持的国家一流大学和世界一流学科建设高校，北京高科大学联盟成员。学校源于哈尔滨工业大学，始建于1920年。1958年，哈尔滨工业大学响应国家号召，将重型机械及相关专业迁至工业重镇齐齐哈尔市富拉尔基区，组建...更多>', 440);
INSERT INTO `schoolinfoall` VALUES ('494', '聊城大学', '山东聊城市', '山东聊城市人气值:8078123', '官方网址：https://admission.lcu.edu.cn/http://www.lcu.edu.cn/\n官方电话：0635-8239405\n电子邮箱：zsb@lcu.edu.cn', '聊城大学坐落于国家级历史文化名城——山东省聊城市，是山东省属综合性大学。学校办学历史可追溯到1902年山东大学堂内设的师范馆。1970年山东师范学院迁至聊城办学，1974年山东师范学院聊城分院建立，1981年经国务院批准更名为聊城师范学院，2002年经教育部批准更名为聊城大学。2012年学校被确定为山东省首批应用型人才培养特...更多>', 441);
