INSERT INTO `schoolinfoall` VALUES ('1023', '阜阳师范大学', '安徽阜阳市', '安徽阜阳市人气值:2552161', '官方网址：http://www.fynu.edu.cn/bkzsxxw/http://www.fynu.edu.cn/\n官方电话：0558-2596225\n电子邮箱：zjc@fynu.edu.cn', '阜阳师范大学是一所多科性本科学校，以本科教育为主，同时承担研究生培养任务。学校坐落在千年历史文化古城、中国特色魅力城市、全国文明城市——阜阳。这里钟灵毓秀、人文荟萃，是老庄文化发源地、管鲍故里、三曹故乡，晏殊、欧阳修、苏轼曾在此为官，有着“百亿粮仓、颍淮善郡、书法名城、生态水城”的美誉。学校毗...更多>', 446);
