INSERT INTO `schoolinfoall` VALUES ('545', '北方民族大学', '宁夏银川市', '宁夏银川市人气值:4352174', '官方网址：https://zsb.nmu.edu.cn/https://www.nmu.edu.cn/\n官方电话：0951-2066992,0951-2066335\n电子邮箱：bfmdzs@nun.edu.cn', '北方民族大学直属国家民族事务委员会，是一所综合性普通高等院校。学校坐落在“塞上江南”——宁夏回族自治区首府银川市，是我国唯一一所建立在民族八省区的中央部委高校。学校前身为西北第二民族学院，始建于1984年，2008年更名为北方民族大学。学校为博士、硕士、学士学位授权单位。学校坚持以习近平新时代中国特色社会...更多>', 491);
