INSERT INTO `schoolinfoall` VALUES ('2520', '保山学院', '云南保山市', '云南保山市人气值:481929', '官方网址：https://zsw.bsnc.cn/http://www.bsnc.cn/\n官方电话：0875-2864662,0875-2864663,0875-2864678\n电子邮箱：bsxyzsjyc@163.com', '历史沿革：保山学院位于云南省保山市，办学历史最早可追溯到1905年创办的“永昌师范学堂”，1978年4月经教育部批准成立保山师范高等专科学校。2009年4月经教育部批准升格为保山学院，实行省市共建，以省为主的管理体制。2013年学校通过审核成为学士学位授予单位，2014年学校获选为云南省首批两所“国门大学”基础能力建设高校之一，...更多>', 493);
INSERT INTO `schoolinfoall` VALUES ('1277', '昆明医科大学海源学院', '云南昆明市', '云南昆明市人气值:1654541', '官方网址：http://zs.kyhyxy.com/kyhyxyzs/webbhttp://www.kyhyxy.com\n官方电话：0871-67985999,0871-68317580\n电子邮箱：kyhyxyzs@163.com', '昆明医科大学海源学院，由原昆明医学院与昆明富达发展实业（集团）有限公司于2001年6月联合创办。2001年7月开始首届招生，2003年9月实现自主招生。2004年1月通过国家教育部首批审核，确认为独立学院,是云南省唯一一所高等医药卫生类本科独立学院。依托昆明医科大学优质的教学资源，雄厚的师资队伍，通过二十年的建设和发展，...更多>', 494);
INSERT INTO `schoolinfoall` VALUES ('2566', '兴义民族师范学院', '贵州黔西南布依族苗族自治州', '贵州黔西南布依族苗族自治州人气值:971331', '官方网址：http://zsjy.xynun.edu.cn/zhaosheng1/index.htmlhttp://www.xynun.edu.cn/v2/\n官方电话：0859-3236966\n电子邮箱：zsjy@xynun.edu.cn', '兴义民族师范学院肇基于1813年重建的笔山书院，历经高等小学堂、兴义县立中学、贵州省兴义中学等历史时期。建国后，于1952年改为贵州省兴义师范学校，开始了现代师范教育的历史。1975年名为兴义地区“五·七”师范大学，1978年改称兴义师范专科学校，1982年改名黔西南民族师专，1993年又更名为黔西南民族师范高等专科学校。2001...更多>', 495);
