INSERT INTO `schoolinfoall` VALUES ('90', '天津职业技术师范大学', '天津河西区', '天津河西区人气值:3721874', '官方网址：https://zb.tute.edu.cn/http://www.tute.edu.cn\n官方电话：400-022-9678\n电子邮箱：tutezsb@tute.edu.cn', '天津职业技术师范大学是教育部与天津市人民政府共建高校、人力资源和社会保障部与天津市人民政府共建高校，天津市高水平特色大学建设高校。学校的发展始终得到了党和国家领导人的亲切关怀和大力支持。2017年9月8日，时任国务院总理李克强来校考察，对学校办学特色和办学成效给予充分肯定，希望学校不仅培养高素质“工匠...更多>', 502);
INSERT INTO `schoolinfoall` VALUES ('561', '北方工业大学', '北京石景山区', '北京石景山区人气值:3624518', '官方网址：http://bkzs.ncut.edu.cn/http://www.ncut.edu.cn\n官方电话：010-88802786\n电子邮箱：zsb@ncut.edu.cn', '学校创立于1946年，前身是国立北平高级工业职业学校，新中国成立后曾先后隶属于冶金工业部和中国有色金属工业总公司，1985年更为现名，1998年划转北京市管理。现已发展成为一所以工为主，理、工、文、经、管、法、艺七大学科门类协调发展，工科优势突出、特色鲜明的高等院校。在76年的办学历程中，学校坚持社会主义办学方向...更多>', 503);
