INSERT INTO `schoolinfoall` VALUES ('1182', '常熟理工学院', '江苏苏州市', '江苏苏州市人气值:2167108', '官方网址：http://zsb.cslg.edu.cn/http://www.cslg.edu.cn/\n官方电话：0512-52251131\n电子邮箱：zsb@cslg.edu.cn', '常熟理工学院坐落于人文荟萃、山明水秀的国家历史文化名城、国际花园城市——苏州常熟，是省市共建省属公立全日制普通本科院校。学校前身是创建于1958年的苏州师范专科学校，1989年，苏州师范专科学校与常熟职业大学合并，成立常熟高等专科学校。2001年江苏省人口学校并入。2004年，经教育部批准升本，更名为常熟理工学院。...更多>', 514);
