INSERT INTO `schoolinfoall` VALUES ('2291', '海南外国语职业学院', '海南省直辖县级行政区划', '海南省直辖县级行政区划人气值:578820', '官方网址：http://hncfs.edu.cn/zjczs/http://www.hncfs.edu.cn\n官方电话：0898-63297715,0898-63297756\n电子邮箱：zsjy008@126.com', '海南外国语职业学院坐落于中国首个滨海卫星发射基地——文昌市，创建于1947年，是经海南省政府批准教育部备案的公办全日制外语类高等职业院校，也是海南省外语语种最多、外语专业最齐的高校。2012年成为全省第二所省市共建高校，2018年成为海南省教育厅批准建设的省级优质高职院校。  学院规划用地650余亩，教学条件优越。拥有...更多>', 629);
